import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the second video item to be visible
    await page.waitForSelector('.video-item:nth-child(2) .video-duration');

    // Extract the duration text from the second video
    const videoDuration = await page.textContent('.video-item:nth-child(2) .video-duration');

    // Take a screenshot after extracting the data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_duration_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_duration_extracted.png'));

    return {
      success: true,
      action: "Extracted video duration from the second video on the homepage",
      extractedData: { videoDuration },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

